webpackJsonp([0x6749188ede23],{3421:function(n,t){n.exports={data:{markdownRemark:{html:"<p><strong>☀</strong></p>\n<p>今日は加須市のむさしの村へ遊びに行きました。\n今日は、彼女の H とそのお姉さんが一緒です！</p>\n<p>車で一時間半とかなり遠かったです。\nH は僕以上に車に弱く、途中下車して道端で戻していました。\n僕がジュースを奢ると、元気になってくれたようです。</p>\n<p>当初『むさしの村』という名前からちょっとしたアスレチックのようなところ、と見繕っていましたが、いざ蓋を開けるとちゃんとした遊園地で驚きました。</p>\n<p>アトラクションも楽しめたし、その日の昼食は最高でした。</p>\n<p>でも僕は二つの心残りがあります。\n一つはもっと遊びたかったこと。\nそしてもうひとつは、彼女と二人だけで行きたかっとことです。</p>",frontmatter:{cover:null,date:"1990-11-23T22:00:00+09:00",strDate:"1990/11/23",title:"日記"}}},pathContext:{path:"/ja/blog/1990/11/23-diary/",langKey:"ja"}}}});
